{
	vec2 R = iResolution.xy,	
	     h = cos( (g+g-R)/R.y * .75 );	
	g /= 18.;	

    f =  h.x*h.y*.6 
        - vec4(.34,1,1,1)/25. 
          / cos(3.14 *( g.y + g.x* sign(sin( 6e3 * length(floor(g)) )) ));
}

